import { useState } from "react";


let AmbulanceProfilePg1 = () => {

    
    let alid=JSON.parse(localStorage.getItem("loginInfo")).lid.lid;
    const[ambulance,setAmbulance]=useState([]);
    setAmbulance(JSON.parse(localStorage.getItem("loginInfo")))

    return(


        <div>
        <h2>hiiiii {alid} </h2>

        <table className="table table-bordered">
                {
                    ambulance.map((a)=>{
                        return (
                            <tr>
                                <td>{a.uname}</td>
                                <td>{a.password}</td>
                                {/* <td>{v.completed.toString()}</td> */}
                            </tr>
                        )
                    })
                }
            </table>        


        </div>
    )




}
export default AmbulanceProfilePg1;
